👇
PQ a mídia não expôs o que realmente foi o relatório do TCU? Pq não divulgou o voto bombástico do revisor do Relatório? TALVEZ PQ ENCONTRARAM O MESMO Q MILITARES. Pq estão em sigilo documentos dos graves  "achados" dos técnicos do TCU?

PQ não expuseram publicamente q os acessos mais importantes foram negados pelo TSE? (tal qual feito aos militares) Lembrando que a Lei proíbe negar acesso de documentos ao TCU em auditoria!!!! O que motiva o Relator colocar em sigilo os achados técnicos?

Nas palavras do Revisor: "... ante os complexos aspectos ainda 
pendentes de análise por parte de nossa competente equipe de auditores e, sobretudo, o relevantíssimo impacto a eles associados, considero prematura qualquer conclusão acerca da matéria."

Nas palavras do Revisor:

"Entre os possíveis achados levantados pela equipe do Tribunal e constantes da Matriz 
de Planejamento (peça 13), destaco: 

i) a baixa governança no desenvolvimento e manutenção dos 
sistemas, deixando-os vulneráveis; 

 ii) fragilidades do processo de auditabilidade, com impacto na 
segurança das urnas; 

iii) a possibilidade de identificação do voto do eleitor, resultando na quebra do sigilo do voto;

iv) a divulgação de dados errados ou sigilosos, o acesso indevido às bases de dados ou sistemas ou o vazamento e alteração de informações, inclusive com impacto no resultado das eleições;

v) violação do sistema interno do TSE de transmissão e consolidação dos dados, com possibilidade de manipulações imperceptíveis, também com impacto no resultado dos pleitos."

Ainda nas palavras do Revisor: 

'Contudo, considerando estarem pendentes relevantes análises por parte da unidade técnica 
do Tribunal, a serem efetuadas na fase seguinte desta auditoria, divirjo, por ora, de alguns posicionamentos já adotados pelo Relator.

Eventual deficiência das estratégias adotadas pelo TSE para identificar e mitigar ou eliminar os riscos de falhas/erros/fraudes no processo eleitoral poderá resultar na persistência de vulnerabilidades dos sistemas, podendo comprometer a confiabilidade de eleições pretéritas e credibilidade do processo de votação no futuro;

O fato de todos os elementos de auditabilidade do voto serem originados da mesma fonte poderá, em caso de contaminação da urna, contaminar o resultado, levando à inutilização do mecanismo de asseguração dos votos no caso de fraude do software, e poderá resultar na contagem de votos indevidos na urna e impactar a credibilidade das eleições;

Devido ao armazenamento da hora de votação de cada eleitor no sistema eletrônico de votação, poderá ocorrer identificação do respectivo voto resultando na quebra do sigilo do voto e impactando a credibilidade das eleições;

A omissão do TSE na requisição, na avaliação e no tratamento das 
atas/relatórios elaborados no âmbito dos TREs e dos cartórios eleitorais acerca das respectivas etapas de verificação/auditoria/fiscalização pode comprometer a realização, o registro e a efetividade dessas etapas, na forma prevista na Resolução TSE 23.603/2019, poderá ocorrer fragilização do processo de verificação/auditoria/fiscalização, com impacto na segurança das urnas, ante a possível persistência de vulnerabilidades, e na credibilidade da votação eletrônica;

A ausência de segregação de funções nos processos críticos poderá permitir que um servidor concentre a execução de atividades essenciais, o que poderá propiciar fraudes nos processos críticos, impactando a segurança do processo de votação eletrônica;

A definição incorreta dos requisitos de negócio para controle de acesso poderá possibilitar o acesso indevido às bases de dados ou aos sistemas, o que poderá levar a acessos não autorizados, a vazamento ou alteração de informações ou à perpetração de fraudes, impactando os resultados e a confiança no sistema de votação eletrônica;

